import uuid
from datetime import datetime

def u():
    return str(uuid.uuid4())

def html_schema(text: str):
    return [[text]]

def build_ad_section(ad_index: int, ad: dict):
    blocks = []

    # Section heading
    blocks.append({
        "uuid": u(),
        "type": "HEADING_2",
        "groupUuid": u(),
        "groupType": "HEADING_2",
        "payload": {"safeHTMLSchema": html_schema(f"ÐžÐ±ÑŠÑÐ²Ð»ÐµÐ½Ð¸Ðµ #{ad_index + 1}")}
    })

    header = ad.get("header", f"ÐžÐ±ÑŠÑÐ²Ð»ÐµÐ½Ð¸Ðµ #{ad_index + 1}")
    link = (ad.get("link") or "").strip()
    posting_date_raw = (ad.get("posting_date") or "").strip()

    # Parse "YYYY-MM-DD HH:MM:SS" -> "DD.MM.YYYY HH:MM"
    posting_date = ""
    if posting_date_raw:
        try:
            dt = datetime.strptime(posting_date_raw, "%Y-%m-%d %H:%M:%S")
            posting_date = dt.strftime("%d.%m.%Y %H:%M")
        except ValueError:
            posting_date = posting_date_raw

    # 1) header block
    blocks.append({
        "uuid": u(),
        "type": "TEXT",
        "groupUuid": u(),
        "groupType": "TEXT",
        "payload": {"safeHTMLSchema": html_schema(f"<b>{header}</b>")}
    })

    # 2) date block
    if posting_date:
        blocks.append({
            "uuid": u(),
            "type": "TEXT",
            "groupUuid": u(),
            "groupType": "TEXT",
            "payload": {"safeHTMLSchema": html_schema(f"Ð”Ð°Ñ‚Ð°: {posting_date}")}
        })

    # 3) link block (real clickable anchor)
    if link:
        blocks.append({
        "uuid": u(),
        "type": "TEXT",
        "groupUuid": u(),
        "groupType": "TEXT",
        "payload": {"html": f'<a href="{link}">Ð¡ÑÑ‹Ð»ÐºÐ° Ð½Ð° Ð¿Ð¾ÑÑ‚</a>'}
    })

    # Q1
    mc_group = u()

    blocks.append({
        "uuid": u(),
        "type": "TITLE",
        "groupUuid": u(),
        "groupType": "QUESTION",
        "payload": {
            "isFolded": False,
            "safeHTMLSchema": html_schema("ÐÐºÑ‚ÑƒÐ°Ð»ÑŒÐ½Ð¾ Ð»Ð¸ Ð¾Ð±ÑŠÑÐ²Ð»ÐµÐ½Ð¸Ðµ?")
        }
    })

    opt_yes_uuid = u()
    opt_no_uuid = u()
    opt_other_uuid = u()

    blocks.append({
        "uuid": opt_yes_uuid,
        "type": "MULTIPLE_CHOICE_OPTION",
        "groupUuid": mc_group,
        "groupType": "MULTIPLE_CHOICE",
        "payload": {
            "index": 0, "isRequired": True, "isFirst": True, "isLast": False,
            "hasOtherOption": True, "text": "ÐžÐ±ÑŠÑÐ²Ð»ÐµÐ½Ð¸Ðµ Ð°ÐºÑ‚ÑƒÐ°Ð»ÑŒÐ½Ð¾"
        }
    })

    blocks.append({
        "uuid": opt_no_uuid,
        "type": "MULTIPLE_CHOICE_OPTION",
        "groupUuid": mc_group,
        "groupType": "MULTIPLE_CHOICE",
        "payload": {
            "index": 1, "isRequired": True, "isFirst": False, "isLast": False,
            "hasOtherOption": True, "text": "ÐžÐ±ÑŠÑÐ²Ð»ÐµÐ½Ð¸Ðµ Ð½Ðµ Ð°ÐºÑ‚ÑƒÐ°Ð»ÑŒÐ½Ð¾"
        }
    })

    blocks.append({
        "uuid": opt_other_uuid,
        "type": "MULTIPLE_CHOICE_OPTION",
        "groupUuid": mc_group,
        "groupType": "MULTIPLE_CHOICE",
        "payload": {
            "isOtherOption": True, "index": 2, "isRequired": True,
            "isFirst": False, "isLast": True, "hasOtherOption": True, "text": "Other"
        }
    })

    # Q2 (hidden)
    q2_title_uuid = u()
    q2_mc_group = u()

    blocks.append({
        "uuid": q2_title_uuid,
        "type": "TITLE",
        "groupUuid": u(),
        "groupType": "QUESTION",
        "payload": {
            "isFolded": False,
            "isHidden": True,
            "safeHTMLSchema": html_schema("Ð§Ñ‚Ð¾ ÑÐ»ÑƒÑ‡Ð¸Ð»Ð¾ÑÑŒ Ñ Ð¶Ð¸Ð²Ð¾Ñ‚Ð½Ñ‹Ð¼?")
        }
    })

    follow_opts = [
        "ÐŸÑ€Ð¸ÑÑ‚Ñ€Ð¾Ð¸Ð»Ð¸",
        "ÐžÑÑ‚Ð°Ð²Ð¸Ð»Ð¸ ÑÐµÐ±Ðµ",
        "Ð£Ð¼ÐµÑ€Ð»Ð¾",
        "ÐŸÑ€Ð¾Ñ…Ð¾Ð´Ð¸Ñ‚ Ð»ÐµÑ‡ÐµÐ½Ð¸Ðµ / Ð°Ð´Ð°Ð¿Ñ‚Ð°Ñ†Ð¸ÑŽ",
        "Ð’Ñ‹Ð¿ÑƒÑÑ‚Ð¸Ð»Ð¸ Ð½Ð° ÑƒÐ»Ð¸Ñ†Ñƒ",
    ]

    follow_opt_uuids = []
    for i, t in enumerate(follow_opts):
        ou = u()
        follow_opt_uuids.append(ou)
        blocks.append({
            "uuid": ou,
            "type": "MULTIPLE_CHOICE_OPTION",
            "groupUuid": q2_mc_group,
            "groupType": "MULTIPLE_CHOICE",
            "payload": {
                "index": i, "isRequired": True, "isFirst": (i == 0), "isLast": False,
                "hasOtherOption": True, "isHidden": True, "text": t
            }
        })

    follow_other_uuid = u()
    blocks.append({
        "uuid": follow_other_uuid,
        "type": "MULTIPLE_CHOICE_OPTION",
        "groupUuid": q2_mc_group,
        "groupType": "MULTIPLE_CHOICE",
        "payload": {
            "isOtherOption": True, "index": len(follow_opts), "isRequired": True,
            "isFirst": False, "isLast": True, "hasOtherOption": True,
            "isHidden": True, "text": "Other"
        }
    })

    # Conditional logic: if Q1 == "not Ð°ÐºÑ‚ÑƒÐ°Ð»ÑŒÐ½Ð¾" => show Q2 blocks
    show_blocks = [q2_title_uuid] + follow_opt_uuids + [follow_other_uuid]

    blocks.append({
        "uuid": u(),
        "type": "CONDITIONAL_LOGIC",
        "groupUuid": u(),
        "groupType": "CONDITIONAL_LOGIC",
        "payload": {
            "updateUuid": u(),
            "logicalOperator": "AND",
            "conditionals": [
                {
                    "uuid": u(),
                    "type": "SINGLE",
                    "payload": {
                        "field": {
                            "uuid": mc_group,
                            "type": "INPUT_FIELD",
                            "questionType": "MULTIPLE_CHOICE",
                            "blockGroupUuid": mc_group,
                            "title": "ÐÐºÑ‚ÑƒÐ°Ð»ÑŒÐ½Ð¾ Ð»Ð¸ Ð¾Ð±ÑŠÑÐ²Ð»ÐµÐ½Ð¸Ðµ?"
